import './nav.css';
import { Link, Route } from 'react-router-dom';

function Nav() {
  return(
      <div>
        <nav>
        <Link to="/">
            <h3>Logo</h3>
        </Link>
        <ul className ="nav-links">
            <Link to='/login'>
                <li>Login</li>
            </Link>
            <Link to='/browse'>
                <li>Browse Trails</li>
            </Link>

        </ul>

    </nav>

    <Route path="/login" component={Login} exact />
    <Route path="/dashboard" component={DashboardComponent} />


   </div>
  );
}

export default Nav;
